import React from "react";
import {
  SidebarContainer,
  ExitButton,
  Slideshow,
  Title,
  Author,
  Description,
} from "./styles";

const Sidebar = ({ closeSidebar, project }) => {
  return (
    <SidebarContainer>
      <ExitButton onClick={closeSidebar}>Close</ExitButton>
      <Slideshow />
      <div className="content-container">
        <Title>{project.properties.title}</Title>
        <Author>{project.properties.artist}</Author>
        <Description
          dangerouslySetInnerHTML={{ __html: project.properties.description }}
        />
      </div>
    </SidebarContainer>
  );
};

export default Sidebar;
